import React from "react";

export default function DeleteContact(props) {
  console.log(props);
  return (
    <div className="ui container" id="delete">
      <div className="ui card container" id="card">
        <div className="content">
          <div className="header" id="head">
            Are You Sure?
          </div>
          <div className="but">
            <button className="ui button red" onClick={yesHandler}>
              Yes
            </button>
            <button className="ui button blue" onClick={noHandler}>
              No
            </button>
          </div>
        </div>
      </div>
    </div>
  );
}
